<script>
    $(document).ready(function () {
        iniDatetimepicker();
        var today = new Date();
        var lastthirtyDay = new Date(today.getTime() - 5184000000);
        $(""#start"").val(lastthirtyDay.getFullYear() + ""-"" + (lastthirtyDay.getMonth() + 1).toString() + ""-"" + lastthirtyDay.getDate());
        $(""#end"").val(today.getFullYear() + ""-"" + (today.getMonth() + 1).toString() + ""-"" + today.getDate());
        gettopErrorcode_bycount(new Array(), $(""#start"").val(), $(""#end"").val());
        getOpenCloseCount(new Array(), $(""#start"").val(), $(""#end"").val());
        gettopErrorCode_byDowntime(new Array(), $(""#start"").val(), $(""#end"").val());
        getDowntime_byDepartment(new Array(), $(""#start"").val(), $(""#end"").val());
    })
    function updateChart() {
        if ($(""#start"").val() > $(""#end"").val()) {
            alert(""开始时间要小于结束时间，请重新选择时间段"");
        }
        else {
            gettopErrorcode_bycount($(""#project-select"").val(), $(""#start"").val(), $(""#end"").val());
